: \"5\", \"Part\": \"\", \"FullPart\": \"\"}, \"contract9\": {\"Full\": \"\", \"Part\": \"\", \"FullPart\": \"\"}}","prices":"{\"Full\": \"90000\", \"Part\": \"\", \"FullPart\": \"\"}","duration":"{\"Full\": \"2.0\", \"Part\": \"\", \"FullPart\": \"\"}"}]';

        $list = json_decode($list);

        $i = 0;

        foreach ($list as $item) {

            $spec = Speciality::where([
                'spec_code' => $item->code,
                'level_code' => $item->level,
            ])->first();

            if ($spec === null)
                continue;

            $item->forms = json_decode($item->forms);
            $item->places = json_decode($item->places);
            $item->prices = json_decode($item->prices);

            $item->duration = json_decode($item->duration);

            foreach ($item->forms as $form => $value) {
                if (empty($value)) continue;

                $i++;

                $record = new Profile();

                $record->fill([
//                    'name'              => $item->name,
                    'alias' => "profile-{$i}",
                    'speciality_code' => $spec->code,
                    'form_code' => match ($form) {
                        'Full' => 'full-time',
                        'Part' => 'correspondence',
                        'FullPart' => 'full-part',
                    },
                    'duration' => (float)$item->duration->{$form},
//                    'total_places'      => (int)$item->places->budget->{$form}+(int)$item->places->contract->{$form},
                    'director' => 'John Doe',
                    'address' => 'City, street, house, auditory',
                    'afc' => false,
                    'price' => (int)$item->prices->{$form},
                ]);

                $record->save();


                if (!empty($item->places->budget->{$form}))
                    $record->places()->save(
                        new Place([
//                            'year'          => 2024,
                            'type' => 'budget',
                            'count' => (int)$item->places->budget->{$form}
                        ])
                    );

                if (!empty($item->places->contract->{$form}))
                    $record->places()->save(
                        new Place([
//                            'year'          => 2024,
                            'type' => 'contract',
                            'count' => (int)$item->places->contract->{$form}
                        ])
                    );

                if (!is_null($item->exams)) {
                    $exams = json_decode($item->exams);

                    foreach ($exams as $exam) {
                        $exam = AcademicSubject::where(['name' => $exam])->first();

                        $record->exams()->save(
                            new Exam([
                                'subject_id' => $exam->id,
                                'required' => true,
